    fishes: {},
    order: {}
  }

  componentDidMount(){
    this.addFish();
  }

  addFish = fish => {

    console.log('Adding a Fish');
  }

  render() {
    return (
      <div className="catch-of-the-day" >
         <div className="menu">
            <Header show="iyiola" />
         </div>
         <Order />
         <Inventory addFish={this.addFish} /> 
      </div>
    )
  }
}


export default App;
